function amountInPoints(amount) {
    var length = amount.length;
    var point = 0;
    var unit = '';
    if (length >= 10) {
        point = (amount / 1000000000);
        unit = 'Arab';
    } else if (length >= 8) {
        point = (amount / 10000000);
        unit = 'Crore';
    } else if (length >= 6) {
        point = (amount / 100000);
        unit = 'Lac';
    } else if (length >= 4) {
        point = (amount / 1000);
        unit = 'Thousand';
    } else {
        point = amount;
    }
    return point + ' ' + unit;
}

